	('4e497da6-55f9-480d-b198-1de70227237d', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Opposite Day: Ask AI: "What would happen if I took the completely opposite approach to a problem I''m working on? What would I discover about what I''m currently missing?" Include details about a specific problem.', 'Imagine It', 'Customer Translation: Ask AI: "Translate my current approach and this opposite approach into what a customer would actually experience. What story does each tell?"', 'Critique It', 'What problems did you realize your current approach might be accidentally creating? What would change if you flipped your perspective?', '{"Our customer service approach creates the problems we''re trying to solve.","We''re optimizing for what we think customers want vs. what they actually experience."}', 'Opposite Strategy Challenge', 6, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/OppositeDay.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL09wcG9zaXRlRGF5LnBuZyIsImlhdCI6MTc0OTYzNzA1NCwiZXhwIjoxODEyNzA5MDU0fQ.JIgvgJAne4Na4myzW6pQemSdkLqzqfcgjNH6zP5hoOY', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/Customer%20TranslationCH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0N1c3RvbWVyIFRyYW5zbGF0aW9uQ0gyLnBuZyIsImlhdCI6MTc0OTYzODc3NiwiZXhwIjoxODEyNzEwNzc2fQ.gFvTDEmkP1kMGteigaRE8haZ1l4an7TsngbbKwydD6E', NULL),
	('7efe16ab-921d-4e02-88a3-17e7eb148961', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Clarity Trap: Take any paragraph you wrote recently and ask AI: "Compress this to one sentence a smart 12-year-old would understand."', 'Explain It', 'Hidden Sophistication: Take that simple sentence and ask AI: "Make this 20% more sophisticated while keeping it just as clear."', 'Improve It', 'What surprised you most about the gap between what you thought was clear communication and what actually landed clearly?', '{"Wow, I thought that was clear but it was actually 3 different ideas crammed together.","The simple version is way more powerful than my original."}', 'Clarity Challenge', 1, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/ClarityTrapA.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0NsYXJpdHlUcmFwQS5wbmciLCJpYXQiOjE3NDk2MzY2ODksImV4cCI6MTgxMjcwODY4OX0.cs1bJ7nojCRatOyYiVmEVcwUw4gHviduxdZLPwDh82M', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/HiddenSoph2CH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0hpZGRlblNvcGgyQ0gyLnBuZyIsImlhdCI6MTc0OTYzOTI5NywiZXhwIjoxODEyNzExMjk3fQ.IEf0TgF_0TYd305gnIAQdbihI2IGUwO6pYq3OlGTgsI', NULL),
	('cb929dea-017e-4a87-a7e8-320783301525', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Invisible Rules: Ask AI: "If I were starting my company culture from scratch today, what would I definitely keep, probably eliminate, and never think to question?"', 'Imagine It', 'Perfect Culture Killer: Take the "never think to question" item and ask AI: "What are 3 ways this seemingly essential rule might actually be holding us back?"', 'Critique It', 'What invisible rule or "that''s just how we do things" moment did you uncover, and how long do you think it''s been holding things back?', '{"We do it this way because ''that''s how it''s always been'' but there''s literally no good reason.","Our ''essential'' meeting/process is actually slowing everyone down."}', 'Culture Rules Challenge', 2, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/InvisibleRulesA.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0ludmlzaWJsZVJ1bGVzQS5wbmciLCJpYXQiOjE3NDk2MzY5NjYsImV4cCI6MTgxMjcwODk2Nn0.4hCwKxEb-X8IqyDcQji24oysdyV2Rlt03XTRRbzAnWM', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/PolishDetectorCH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL1BvbGlzaERldGVjdG9yQ0gyLnBuZyIsImlhdCI6MTc0OTY0MjU0OCwiZXhwIjoxODEyNzE0NTQ4fQ.q11aWHxEPx6wOLd9sA5-35LFHWCDL7dz6-I215Hp7yU', NULL),
	('0e44a721-5d09-4e4f-bb5c-daae3b8d9467', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Jargon Translator: Take any confusing document/memo and ask AI: "Explain this like I''m smart but completely new to this context. What are they actually saying?"', 'Explain It', 'Project Decoder: Ask AI: "Use that same clarity to break my next project into 4 milestones that anyone could understand and track."', 'Plan It', 'Tell us about the "clear" instructions that turned out to be confusing - what did you realize about how you''ve been approaching complex projects?', '{"This ''clear'' memo has 6 different interpretations.","My project seems overwhelming because I never broke it into actual steps."}', 'Jargon Translation Challenge', 12, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/JargonTranslator%20(1).png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0phcmdvblRyYW5zbGF0b3IgKDEpLnBuZyIsImlhdCI6MTc0OTY1ODAxMiwiZXhwIjoxODEyNzMwMDEyfQ.YamFCVK9btkPBsJ3SiXJTJmqFIeLV1bBpOkT1c7R3tE', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/ProjectDecoderCH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL1Byb2plY3REZWNvZGVyQ0gyLnBuZyIsImlhdCI6MTc0OTY0NTU4MiwiZXhwIjoxODEyNzE3NTgyfQ._dO7dgCFCfWqiPHQND2qTD9ARiazoJO7JsWlaw-TvFY', NULL),
	('25d69901-9b6f-44fc-97c9-f79ad13b5262', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Avoidance Archaeology: Ask AI: "I''ve been avoiding [task]. Help me understand what I''m really avoiding - is it the task itself or something deeper?"', 'Improve It', 'Resistance Resolver: Ask AI: "Now walk me through starting this avoided task in a way that addresses what I''m actually resistant to, not just the surface task."', 'Guide It', 'What did you discover you were really avoiding underneath that task you keep putting off? How did it feel to name the real resistance?', '{"I''m not avoiding the task - I''m avoiding the possibility of being wrong/exposed/judged.","Starting isn''t hard once I address the real fear."}', 'Avoidance Challenge', 15, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/AvoidanceArchaeology.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0F2b2lkYW5jZUFyY2hhZW9sb2d5LnBuZyIsImlhdCI6MTc0OTYzNjU4NSwiZXhwIjoxODEyNzA4NTg1fQ.J1rIX3KF7Too6LTSSVTiQHLPNoR843K0pymqVnm2lZs', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/Resistance%20ResolverCH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL1Jlc2lzdGFuY2UgUmVzb2x2ZXJDSDIucG5nIiwiaWF0IjoxNzQ5NjQyNjU0LCJleHAiOjE4MTI3MTQ2NTR9.muCv5AIX0suTqtWSQ5SEV1dLZcIlifeTIU6xkpBaELU', NULL),
	('6d119b7b-55a7-446b-9ddc-30a34d2af564', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Bias Detector: Ask AI: "In this decision I''m making, what assumptions am I taking for granted? What perspectives am I not considering?"', 'Critique It', 'Workflow Archaeology: Ask AI: "Based on those blind spots in my thinking, what friction in my daily workflow am I probably not seeing?"', 'Suggest It', 'What assumption about how others think were you making that created blind spots you couldn''t see? How did this show up in your work?', '{"I''m not considering an obvious stakeholder because I assume they think like me.","My ''time-saving'' workflow wastes 2 hours daily because I can''t see my own blind spot."}', 'Bias Detection Challenge', 8, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/BiasDetector.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0JpYXNEZXRlY3Rvci5wbmciLCJpYXQiOjE3NDk2MzY2MjIsImV4cCI6MTgxMjcwODYyMn0.0Q5Hp6dYjiESvWPgkL7bLPwdAi0hLN_-fFlvhmMw6QU', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/Workflow%20ArchaeologyCH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL1dvcmtmbG93IEFyY2hhZW9sb2d5Q0gyLnBuZyIsImlhdCI6MTc0OTY0NTE5MywiZXhwIjoxODEyNzE3MTkzfQ.0zRvBoRgkN9Mefde7DFiAczP8wg05EZQk_NXUKSxYB4', NULL),
	('28c1afca-ef46-49fb-b7f8-4baaf67f19e6', '2025-05-25 15:06:35.934849+00', '2025-05-25 15:06:35.934849+00', 'Energy Audit: Ask AI: "Design an ideal day for tomorrow that matches my energy patterns and priorities - 5 key blocks that would actually energize me."', 'Plan It', 'Mundane Magic: Take the least exciting thing on tomorrow''s schedule and ask AI: "How could I add one element that makes this genuinely interesting or meaningful?"', 'Improve It', 'What did you learn about your natural energy patterns that you''d been working against? How might you design differently going forward?', '{"I''m doing my hardest work when my brain is fried.","This boring task is actually connected to something I care deeply about."}', 'Energy Challenge', 10, true, 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/EnergyAudit.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL0VuZXJneUF1ZGl0LnBuZyIsImlhdCI6MTc0OTYzNjc5MywiZXhwIjoxODEyNzA4NzkzfQ.36znV552q1uesX14c844GhiVU1Tri5a9tw9Gijf1dFA', 'https://lraquxxdgyijafncczmr.supabase.co/storage/v1/object/sign/challenge-images/MundaneMagicCH2.png?token=eyJraWQiOiJzdG9yYWdlLXVybC1zaWduaW5nLWtleV85ZWE0MzI2OC1lZTQ3LTRmOGEtOWNhMC05MWRhYjI4ZDY0NGQiLCJhbGciOiJIUzI1NiJ9.eyJ1cmwiOiJjaGFsbGVuZ2UtaW1hZ2VzL011bmRhbmVNYWdpY0NIMi5wbmciLCJpYXQiOjE3NDk2MzkzMjksImV4cCI6MTgxMjcxMTMyOX0.oOdsV9Ywb_G61cThCIndBKyZ9c4HjuWC0OcdAeSUqas', NULL),
